import React from 'react';

const PropertySearchFrom = () => {
    return ( 

        <div className="container-fluid">
            <div className="container mt-5">
                <div className="row">
                    <ul className="property-search d-flex">
                    <li>Home</li>
                    <li>>> Property Search </li>
                    <li>>> Search Result </li>
                    </ul>
                </div>
            </div>
            <div className="container mt-5">
                <div className="row">
                    
                </div>
            </div>
        </div>
     );
}
 
export default PropertySearchFrom;
